<H2 CLASS="title6"><font color="#ffffff">オススメ商品</H2>

アメリカのHILLMAN社製　レター＆ナンバービニルステッカーセット。
<BR><BR>ツヤッとしたテカリのある質感のカッティングされたアルファベット・数字・記号が　合計99ピースのセット。
<BR>
<BR>・文字サイズは、3インチ(高さ約7.5cm ※記号除く)。
<BR>・文字種は、『A～Z  0～9　6種の記号』　計99ピース/1セット。
<br>（※文字・記号により数量が異なります。画像参照）
<br><br>屋外でも使用できる、耐水・耐候（UVコーティング）のシールです。
<BR><BR>文字が予めカッティングされているので手間入らずで、
<br>ヘルメット・ポスト・バイク等やシャッター・お店のウインドウガラス等々に
<br>名前やメッセージサインを貼り付け、簡単にオリジナルカスタムを楽しむことができます。
<BR><BR>アメリカンライフ・ガレージライフをより自分らしく演出できる、アメリカで日常的に使用されているカッティングステッカーです。
<br><br>※ご使用のモニター環境などで、実物と色目・素材感が異なる場合がございますのでご了承下さい。
<br><br><B>【SPEC】</B>新品　ビニル製　made in U.S.A.
<br><br><b>【お読み下さい】</b>
<br>・輸入商品ですので若干の反り・パッケージ傷み等があるやもしれませんがご了承の上、お買求め下さい。
<br>・耐水・耐候は、ご使用環境で耐久性が大きく異なりますのでご理解・ご了承下さい。
<br>・細かい部分もございますので、台紙から剥がす時は、破れたり、ねじれたりしないよう慎重にお取扱下さい。
<br>・貼付する箇所の、汚れ等よく拭き取り、表面が乾いてから、ざらざら・凸凹のないフラットな面にお貼り下さい。
<br><br><font color=＃FF0000>●本商品はご注文タイミングやご注文内容によっては、購入履歴からのご注文キャンセル、修正を受け付けることができない場合がございます。</font>
